// SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IUniswapV3Factory.sol";

contract Axon is ERC20, ERC20Burnable, Ownable {
    //////////////////////////////////////////////////////////////////////////////////////////////////
    // State
    //////////////////////////////////////////////////////////////////////////////////////////////////

    uint256 private s_vestingPercentFee = 100 * 1 ether;  // Initial fee (100%)
    uint256 private s_basePercentFee= 3 * 1 ether; // Minimund permanent fee (3%)
    uint256 private s_timeVestingPeriod = 730 days; // 2 years (seconds)
    uint256 private s_dateVestingStart;
    
    address private s_salesContract; // Sales contract address
    address private s_companyAddress; // Company address
    address private s_liquidityAddress; // Liquidity
    address private s_addressStake; // Stake
    address private s_poolAddress; // Pool Adddress Uniswap
    
    IUniswapV3Factory private constant FACTORY_UNISWAP = IUniswapV3Factory(0x1F98431c8aD98523631AE4a59f267346ea31F984);
    address private immutable WMATIC;
    mapping(address => bool) private whiteListFees; // No fees transfers.

    //////////////////////////////////////////////////////////////////////////////////////////////////
    // Constructor
    ////////////////////////////////////////////////////////////////////////////////////////////////// 

    constructor(
        string memory _name, 
        string memory _token,
        address p_salesContract,
        address p_companyaddress,
        address p_liquidityaddress,
        address p_addressStake,
        address p_wmatic       
    ) ERC20(_name, _token) {
        s_salesContract = p_salesContract;
        s_companyAddress = p_companyaddress;
        s_liquidityAddress = p_liquidityaddress;
        s_addressStake = p_addressStake;
        
        // Total Supply => 1000M (100%)
        _mint(s_salesContract, 500 * 1000000 * 1 ether); // 500M (50%)
        _mint(s_companyAddress, 300 * 1000000 * 1 ether); // 300M (30%)
        _mint(s_liquidityAddress, 200 * 1000000 * 1 ether); // 200M (20%)

        whiteListFees[s_salesContract] = true;
        whiteListFees[s_liquidityAddress] = true;

        // Polygon: 0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270
        // Polygon Mumbai: 0x9c3C9283D3e44854697Cd22D3Faa240Cfb032889
        WMATIC = p_wmatic; 

        s_dateVestingStart = block.timestamp;   
    } 

    //////////////////////////////////////////////////////////////////////////////////////////////////
    // Public functions
    //////////////////////////////////////////////////////////////////////////////////////////////////   

    // => View functions

    function salesContract() public view returns(address) {
        return s_salesContract;
    }

    function addressStake() public view returns(address) {
        return s_addressStake;
    }

    function companyAddress() public view returns(address) {
        return s_companyAddress;
    }

    function percentFee() public view returns(uint256) {
        return _currentPercentFee();
    }

    function _amountFee(uint256 p_amountToTransfer) public view returns(uint256) {
        return _amountFee(p_amountToTransfer, _currentPercentFee());
    }

    function poolAddress() public view returns(address) {
        return s_poolAddress;
    }

    // => Set functions

    function setPoolAddress(address p_poolAddress) public onlyOwner returns(bool) {
        if (s_poolAddress != address(0)) { delete whiteListFees[s_poolAddress]; }

        s_poolAddress = p_poolAddress;

        whiteListFees[s_poolAddress] = true;

        return true;
    }
    
    function transfer(address p_to, uint256 p_amount) public virtual override returns(bool) {
        if (!whiteListFees[msg.sender]) {
            _executeFees(msg.sender, p_amount);
        }
        
        return super.transfer(p_to, p_amount);
    }

    function transferFrom(address p_from, address p_to, uint256 p_amount) public virtual override returns (bool) {
        if (!whiteListFees[p_from]) {
            _executeFees(p_from, p_amount);
        }    
        
        return super.transferFrom(p_from, p_to, p_amount);
    }

    function setaddressStake(address _newaddressStake) public onlyOwner returns(bool) {
        s_addressStake = _newaddressStake;
        
        return true;
    }

    //delete
    function _toggleWhitelist(address _account) internal  {
        whiteListFees[_account] = !whiteListFees[_account];
    }

    function initPool(address _tokenPool) public onlyOwner {
        IUniswapV3Factory factory = IUniswapV3Factory(0x1F98431c8aD98523631AE4a59f267346ea31F984);
        require(factory.getPool(address(this), _tokenPool, 3000) == address(0)); 
        address pool = factory.createPool(address(this), _tokenPool, 3000);

        whiteListFees[pool] =true;
    }

    //////////////////////////////////////////////////////////////////////////////////////////////////
    // Internal functions
    //////////////////////////////////////////////////////////////////////////////////////////////////

    // Percent Fee
    function _currentPercentFee() internal view returns(uint256) {
        uint256 finalTime = s_dateVestingStart + s_timeVestingPeriod;

        if (block.timestamp >= finalTime) { return s_basePercentFee; }

        uint256 diffTimeSeconds = block.timestamp - s_dateVestingStart;
        uint256 discountPercentSecond = (s_vestingPercentFee - s_basePercentFee) / (s_timeVestingPeriod) ;
        uint256 percentFee18Decimals = s_vestingPercentFee - (discountPercentSecond * diffTimeSeconds);

        return percentFee18Decimals / 0.01 ether; // 2 decimals
    }

    // Amount Fee
    function _amountFee(uint256 p_amountToTransfer, uint256 p__currentPercentFee) internal pure returns(uint256) {
        return  (p_amountToTransfer * p__currentPercentFee) / 10000;
    }

    function _executeFees(address p_from, uint256 p_amount) internal {
        uint256 total_amountFee = _amountFee(p_amount, _currentPercentFee());

        if (total_amountFee * 30 >= 100){
            _burn(p_from, (total_amountFee * 30) / 100);

            if (p_from != msg.sender) { decreaseAllowance(msg.sender, (total_amountFee * 30) / 100); }
        } else {
            _burn(p_from, 1);

            if (p_from != msg.sender) { decreaseAllowance(msg.sender, 1); }
        }

        if (total_amountFee * 70 >= 100){
            _transfer(p_from, s_addressStake, (total_amountFee * 70) / 100);  

            if (p_from != msg.sender) { decreaseAllowance(msg.sender, (total_amountFee * 70) / 100); }    
        } else {
            _transfer(p_from, s_addressStake, 1);

            if (p_from != msg.sender) { decreaseAllowance(msg.sender, 1); }
        }
    }
}
